/* =========================
	 ハイブリッド暗号 QR生成
	 - AES-GCMで本文暗号化
	 - RSA-OAEP(SHA-256)でAES鍵暗号化
	 - QR生成
	 - 空欄可
	 - 簡易レート制限
	 ========================= */

