// --------------------
// ユーティリティ関数
// --------------------
function pemToUint8(pem) {
	const b64 = pem.replace(/-----.*?-----/gs, "").replace(/\s+/g, "");
	return Uint8Array.from(atob(b64), c => c.charCodeAt(0));
}
function uint8ToBase64(u8) {
	return btoa(String.fromCharCode(...u8));
}
function concatUint8Arrays(...arrays) {
	const total = arrays.reduce((s, a) => s + a.length, 0);
	const out = new Uint8Array(total);
	let offset = 0;
	for (const a of arrays) {
		out.set(a, offset);
		offset += a.length;
	}
	return out;
}

// RSA公開鍵のインポート
async function importRsaPublicKey(pem) {
	const der = pemToUint8(pem);
	return crypto.subtle.importKey(
		"spki",
		der.buffer,
		{ name: "RSA-OAEP", hash: "SHA-256" },
		false,
		["encrypt"]
	);
}

// ハイブリッド暗号化関数
async function hybridEncrypt(plainText, publicKeyPem) {
	const rsaKey = await importRsaPublicKey(publicKeyPem);

	// AES-256鍵生成
	const aesKey = await crypto.subtle.generateKey({ name: "AES-GCM", length: 256 }, true, ["encrypt"]);
	const rawAesKey = new Uint8Array(await crypto.subtle.exportKey("raw", aesKey));

	// RSA-OAEPでAES鍵暗号化
	const encryptedAesKey = new Uint8Array(await crypto.subtle.encrypt({ name: "RSA-OAEP" }, rsaKey, rawAesKey));

	// AES-GCMで本文暗号化
	const iv = crypto.getRandomValues(new Uint8Array(12));
	const enc = new TextEncoder();
	const cipherBuf = await crypto.subtle.encrypt({ name: "AES-GCM", iv }, aesKey, enc.encode(plainText));
	const cipherUint8 = new Uint8Array(cipherBuf);

	// ペイロード: version(1) + keylen(2) + encryptedKey + iv + cipher
	const version = new Uint8Array([0x01]);
	const keyLen = encryptedAesKey.length;
	const keyLenBytes = new Uint8Array([ (keyLen >> 8) & 0xff, keyLen & 0xff ]);
	const payload = concatUint8Arrays(version, keyLenBytes, encryptedAesKey, iv, cipherUint8);

	return uint8ToBase64(payload);
}

async function generateQR(text) {
	const qrCanvas = document.createElement("canvas");

	// QRコード本体生成
	await QRCode.toCanvas(qrCanvas, text, {
		width: 640,
		margin: 6, // セーフゾーン拡大
		errorCorrectionLevel: "M" // 復元性高め
	});

	// ロゴ・テキストの準備
	const logo = new Image();
	logo.crossOrigin = "anonymous";
	logo.src = "data:image/jpeg;base64,";
	await logo.decode();

	const label = "お客様が入力された個人情報が含まれています、お取り扱いには十分ご注意ください.\nこちらのQRコードは、フルコンプ各店で買取時に使用するものです.使用できる店舗は以下の通りです.\n・フルコンプ秋葉原店\n・フルコンプ秋葉原ラジオ会館店\n・フルコンプ池袋店\n・フルコンプ渋谷東口店\n・フルコンプ横浜店\n・フルコンプ川崎店\n・フルコンプ本厚木店\n・フルコンプ千葉店";
	const lines = label.split(/\n/);
	const lineHeight = 24; // 行間の高さ
	const totalTextHeight = lines.length * lineHeight;
	
	const padding = 40;
	const logoHeight = 60;
	const textHeight = 120;
	const qrSize = qrCanvas.width;

	const totalHeight = logoHeight + padding + qrSize + padding + totalTextHeight + padding;
	const totalWidth = qrSize + padding * 2;

	const finalCanvas = document.createElement("canvas");
	finalCanvas.width = totalWidth;
	finalCanvas.height = totalHeight;
	finalCanvas.style.width = `${totalWidth}px`;
	finalCanvas.style.height = `${totalHeight}px`;
	const ctx = finalCanvas.getContext("2d");

	// 背景白
	ctx.fillStyle = "#fff";
	ctx.fillRect(0, 0, totalWidth, totalHeight);

	// 上部ロゴ描画
	const logoX = (totalWidth - logo.width * (logoHeight / logo.height)) / 2;
	ctx.drawImage(logo, logoX, 0, logo.width * (logoHeight / logo.height), logoHeight);

	// QRコード描画
	ctx.drawImage(qrCanvas, padding, logoHeight + padding, qrSize, qrSize);

	// 下部テキスト
	ctx.fillStyle = "#999";
	ctx.font = "bold 14px sans-serif";
	ctx.textAlign = "center";
	const startY = logoHeight + padding + qrSize + textHeight / 1.5;

	lines.forEach((line, i) => {
	ctx.fillText(line, totalWidth / 2, startY + i * lineHeight);
	});
	//ctx.fillText(label, totalWidth / 2, logoHeight + padding + qrSize + textHeight / 1.5);

	// 表示
	const container = document.getElementById("qrcode");
	container.innerHTML = "";
	container.appendChild(finalCanvas);

	//呼び出し元に返す
	return finalCanvas;
}


// --------------------
// 簡易レート制限（クライアント側）
// --------------------
const COOLDOWN_MS = 500;	 // 0.5秒間隔
const MAX_PER_DAY = 500;		 // 日次上限
let lastGeneratedAt = 0;

function canGenerate() {
	const now = Date.now();
	if (now - lastGeneratedAt < COOLDOWN_MS) return { ok: false, reason: "COOLDOWN" };
	const today = new Date().toISOString().slice(0,10);
	const data = JSON.parse(localStorage.getItem("qrRateLimit") || "{}");
	if (data.date !== today) return { ok: true };
	if ((data.count || 0) >= MAX_PER_DAY) return { ok: false, reason: "DAILY_LIMIT" };
	return { ok: true };
}

function recordGeneration() {
	lastGeneratedAt = Date.now();
	const today = new Date().toISOString().slice(0,10);
	const data = JSON.parse(localStorage.getItem("qrRateLimit") || "{}");
	const count = (data.date === today ? (data.count||0) + 1 : 1);
	localStorage.setItem("qrRateLimit", JSON.stringify({ date: today, count }));
}
// --------------------
// デバッグ用：フォームに初期値を設定
// --------------------
window.addEventListener("DOMContentLoaded", () => {
	document.getElementById("lastNameInput").value = "山田";
	document.getElementById("firstNameInput").value = "太郎";
	document.getElementById("lastNameKanaInput").value = "ヤマダ";
	document.getElementById("firstNameKanaInput").value = "タロウ";
	document.getElementById("address1Input").value = "和歌山県";
	document.getElementById("address2Input").value = "千代田区外神田1-15-16 秋葉原ラジオ会館 9F";
	document.getElementById("birthdayInput").value = "19950101";
	document.getElementById("phoneInput").value = "09012345678";
});
// --------------------
// フォーム送信処理
// --------------------
document.getElementById("qrForm").addEventListener("submit", async (e) => {
	e.preventDefault();

	const check = canGenerate();
	if (!check.ok) {
		if (check.reason === "COOLDOWN") return alert("QR生成は数秒ごとに制限されています。少し待ってください。");
		if (check.reason === "DAILY_LIMIT") return alert("本日のQR生成上限に達しました。");
	}

	let lastName = document.getElementById("lastNameInput")?.value.trim() || "";
	let firstName = document.getElementById("firstNameInput")?.value.trim() || "";
	let lastKana = document.getElementById("lastNameKanaInput")?.value.trim() || "";
	let firstKana = document.getElementById("firstNameKanaInput")?.value.trim() || "";
	let addr1 = document.getElementById("address1Input")?.value.trim() || "";
	let addr2 = document.getElementById("address2Input")?.value.trim() || "";
	let birthday = document.getElementById("birthdayInput")?.value.trim() || "";
	let phone = document.getElementById("phoneInput")?.value.trim() || "";

	// 職業の取得
	const jobRadios = document.querySelectorAll('input[name="occupation"]');
	let occupation = "";
	for (const r of jobRadios) {
		if (r.checked) {
		if (r.value === "会社員") occupation = "1";
		else if (r.value === "公務員") occupation = "2";
		else if (r.value === "自営業") occupation = "3";
		else if (r.value === "フリーター") occupation = "4";
		else if (r.value === "学生") occupation = "5";
		else if (r.value === "その他") {
			// 「その他」の場合はテキストボックスの内容をそのまま使う
			occupation = document.getElementById("occupationOther").value.trim() || "その他";
		}
		break;
		}
	}

	// 住所の半角カンマを全角に変換
	addr1 = addr1.replace(/,/g, "，");
	addr2 = addr2.replace(/,/g, "，");

	//生年月日のスラッシュを除去
	birthday = birthday.replace(/\//g, "");

	//電話番号のハイフンを除去
	phone = phone.replace(/[-－]/g, "");


	// JSON化して短くまとめる
	const plain = [lastName, firstName, lastKana, firstKana, addr1, addr2, birthday, phone, occupation].join(",");

	try {
		const base64Payload = ">" + (await hybridEncrypt(plain, PUBLIC_KEY_PEM)) + "<";
		//const base91Payload = Base91.encode(payload); // ← Base64の代わりにBase91

		
		// QR生成
		const qrContainer = document.getElementById("qrcode");
		qrContainer.innerHTML = "";
		const canvas = await generateQR(base64Payload);
		//const canvas = document.createElement("canvas");
		//await QRCode.toCanvas(canvas, base64Payload, { width: 640, errorCorrectionLevel: "M", margin: 8 });
		qrContainer.appendChild(canvas);


		// 文字列表示（デバッグ用）
		const textDiv = document.getElementById("qrText");
		textDiv.textContent = base64Payload;
		textDiv.style.display = "block"; // 表示


		// ダウンロードボタン
		const downloadBtn = document.getElementById("downloadBtn");
		downloadBtn.style.display = "inline-block";
		downloadBtn.onclick = () => {
		const link = document.createElement("a");
		link.href = canvas.toDataURL("image/png", 1.0);
		link.download = "qrcode.png";
		link.click();
	};

		recordGeneration();
	} catch (err) {
		console.error(err);
		alert("QR生成に失敗しました。開発者コンソールを確認してください。");
	}
});

// 「その他」選択時に入力欄を表示
document.querySelectorAll('input[name="occupation"]').forEach(radio => {
  radio.addEventListener('change', () => {
    const otherInput = document.getElementById("occupationOther");
    if (radio.value === "その他" && radio.checked) {
      otherInput.style.display = "block";
    } else if (radio.checked) {
      otherInput.style.display = "none";
      otherInput.value = "";
    }
  });
});
